import React, { useState } from "react";
import clsx from "clsx";
import { makeStyles } from "@material-ui/core/styles";
import CssBaseline from "@material-ui/core/CssBaseline";
import Drawer from "@material-ui/core/Drawer";
import Box from "@material-ui/core/Box";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import List from "@material-ui/core/List";
import Divider from "@material-ui/core/Divider";
import IconButton from "@material-ui/core/IconButton";
import Container from "@material-ui/core/Container";
import Grid from "@material-ui/core/Grid";
import MenuIcon from "@material-ui/icons/Menu";
import ChevronLeftIcon from "@material-ui/icons/ChevronLeft";
import { mainListItems } from "./listItems";
import Table from "../../component/admin/TableMain";
import InputDate from "../../component/admin/InputDate";
import "../../index.css";
import get from "../../service/getTable";
import Modal from "../../component/admin/Modals";

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
  },
  toolbar: {
    paddingRight: 24, // keep right padding when drawer closed
  },
  toolbarIcon: {
    display: "flex",
    alignItems: "center",
    justifyContent: "flex-end",
    padding: "0 8px",
    ...theme.mixins.toolbar,
  },
  appBar: {
    zIndex: theme.zIndex.drawer + 1,
    transition: theme.transitions.create(["width", "margin"], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
  },
  appBarShift: {
    marginLeft: drawerWidth,
    width: `calc(100% - ${drawerWidth}px)`,
    transition: theme.transitions.create(["width", "margin"], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  menuButton: {
    marginRight: 36,
  },
  menuButtonHidden: {
    display: "none",
  },
  title: {
    flexGrow: 1,
  },
  drawerPaper: {
    position: "relative",
    whiteSpace: "nowrap",
    width: drawerWidth,
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  drawerPaperClose: {
    overflowX: "hidden",
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
    width: theme.spacing(7),
    [theme.breakpoints.up("sm")]: {
      width: theme.spacing(9),
    },
  },
  appBarSpacer: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    height: "100vh",
    overflow: "auto",
  },
  container: {
    paddingTop: theme.spacing(4),
    paddingBottom: theme.spacing(4),
  },
  paper: {
    padding: theme.spacing(2),
    display: "flex",
    overflow: "auto",
    flexDirection: "column",
  },
  fixedHeight: {
    height: 240,
  },
}));

export default function Dashboard() {
  const classes = useStyles();
  var today = new Date();
  var dd = String(today.getDate()).padStart(2, "0");
  var mm = String(today.getMonth() + 1).padStart(2, "0"); //January is 0!
  var yyyy = today.getFullYear();

  today = yyyy + "-" + mm + "-" + dd;

  const [date, setDate] = useState({
    startdate: "2020-01-01",
    enddate: today,
  });
  const [open, setOpen] = React.useState(true);
  const handleDrawerOpen = () => {
    setOpen(true);
  };
  const handleDrawerClose = () => {
    setOpen(false);
  };

  const [data, setData] = useState({ datas: [] });
  const [stat, setStatus] = useState({
    status: 200,
    fetch: true,
    text: "ok",
  });
  const url =
    "https://cubioinfo.com/aptitude-test/api/answersheets/" +
    date.startdate +
    "/" +
    date.enddate;
  const onSubmit = async () => {
    const result = await get(date.startdate, date.enddate);
    const newStatus = stat;

    if (result === 404) {
      newStatus.status = 404;
      newStatus.text = "หาไม่พบ";
      setData({ ...data, datas: [] });
      setStatus(newStatus);
    }
    if (result === 500) {
      newStatus.status = 500;
      newStatus.text = "โปรแกรมผิดพลาด";
      setStatus(newStatus);
    }
    if (result === 999) {
      newStatus.status = 999;
      newStatus.text = "เกิดความผิดพลาด";
      setStatus(newStatus);
    }
    if (result !== 404 || result !== 500 || result !== 501) {
      for (var i in result) {
        if (result[i].gndr) {
          result[i].gndr = "ชาย";
        } else {
          result[i].gndr = "หญิง";
        }
      }
      for (var i in result) {
        var choice=[]
        for (var s = 0; s < result[i].length; s++) {
          choice.push(result[i].charAt(s));
        }
        console.log(choice)
        result[i].no1=choice[0]
        result[i].no2=choice[1]
        result[i].no3=choice[2]
        result[i].no4=choice[3]
        result[i].no5=choice[4]
        result[i].no6=choice[5]
        result[i].no7=choice[6]
        result[i].no8=choice[7]
        result[i].no9=choice[8]
        result[i].no10=choice[9]
        result[i].no11=choice[10]
        result[i].no12=choice[11]
        result[i].no13=choice[12]
        result[i].no14=choice[13]
        result[i].no15=choice[14]
        result[i].no16=choice[15]
        result[i].no17=choice[16]
        result[i].no18=choice[17]
        result[i].no19=choice[18]
        result[i].no20=choice[19]
        result[i].no21=choice[20]
        result[i].no22=choice[21]
        result[i].no23=choice[22]
        result[i].no24=choice[23]
        result[i].no25=choice[24]
        result[i].no26=choice[25]
        result[i].no27=choice[26]
        result[i].no28=choice[27]
        result[i].no29=choice[28]
        result[i].no30=choice[29]
        result[i].no31=choice[30]
        result[i].no32=choice[31]
        result[i].no33=choice[32]
        result[i].no34=choice[33]
        result[i].no35=choice[34]
        result[i].no36=choice[35]
        result[i].no37=choice[36]
        result[i].no38=choice[37]
        result[i].no39=choice[38]
        result[i].no40=choice[39]
        result[i].no41=choice[40]
        choice=[]
      }
      setData({ ...data, datas: result });

    }
    console.log(data)
  };
  return (
    <div className={classes.root}>
      <CssBaseline />
      <AppBar
        position="absolute"
        color="primary"
        className={clsx(classes.appBar, open && classes.appBarShift)}
      >
        <Toolbar className={classes.toolbar}>
          <IconButton
            edge="start"
            color="inherit"
            aria-label="open drawer"
            onClick={handleDrawerOpen}
            className={clsx(
              classes.menuButton,
              open && classes.menuButtonHidden
            )}
          >
            <MenuIcon />
          </IconButton>
          <h5>ระบบประเมินความสนใจของบุคคลที่มีต่อหน่วยงานราชการไทย</h5>
        </Toolbar>
      </AppBar>

      <Drawer
        variant="permanent"
        classes={{
          paper: clsx(classes.drawerPaper, !open && classes.drawerPaperClose),
        }}
        open={open}
      >
        <div className={classes.toolbarIcon}>
          <IconButton onClick={handleDrawerClose}>
            <ChevronLeftIcon />
          </IconButton>
        </div>
        <Divider />
        <List>{mainListItems}</List>
        <Divider />
      </Drawer>
      <main className={classes.content}>
        <div className={classes.appBarSpacer} />
        <Container maxWidth="lg" className={classes.container}>
          <Grid container spacing={3}>
            {/* รับวันที่ */}
            <InputDate date={date} setDate={setDate} onSubmit={onSubmit} />
          </Grid>

          <Box pt={4}>
            {stat.status === 500 || stat.status === 501 ? (
              <Modal status={stat.status} link={url} />
            ) : (
              <Table date={data} />
            )}
          </Box>
        </Container>
      </main>
    </div>
  );
}
